import React, { Component } from "react"
import { Link } from "react-router-dom"

export class Header extends Component {
  constructor(props) {
    super(props)
    this.state = {
      categories: []
    }
  }

  render() {
    const { categories } = this.state
    return (
      <header>
        <nav>
          {categories.map(({ name }) => (
            <ul key={name}>
              <li>
                <Link to={`/${name}`}>{name}</Link>
              </li>
            </ul>
            ))}
        </nav>
      </header>
    )
  }
}

export default Header
